=head1 DESCRIPTION

Publish internet measurements to an Amazon S3 bucket in addition to
CloudWatch Logs.

=head1 ATTRIBUTES


=head2 S3Config => L<Paws::InternetMonitor::S3Config>

The configuration information for publishing Internet Monitor internet
measurements to Amazon S3. The configuration includes the bucket name
and (optionally) prefix for the S3 bucket to store the measurements,
and the delivery status. The delivery status is C<ENABLED> or
C<DISABLED>, depending on whether you choose to deliver internet
measurements to S3 logs.



